    * { margin: 0; padding: 0; box-sizing: border-box; }

    .controls { display: flex; justify-content: center; gap: 15px; margin-bottom: 15px; flex-wrap: wrap; align-items: center; }

    .stats-display strong { color: #00d4ff; }
    .main-content { display: flex; gap: 15px; height: calc(100vh - 200px); min-height: 500px; }
    .network-panel { flex: 1; background: #fff; border-radius: 15px; overflow: hidden; }
    #network { width: 100%; height: 100%; }
    .legend-panel { width: 220px; background: rgba(255,255,255,0.08); border-radius: 15px; padding: 15px; overflow-y: auto; }
    .legend-panel h3 { font-size: 1em; margin-bottom: 15px; border-bottom: 1px solid rgba(255,255,255,0.2); padding-bottom: 10px; }
    .legend-item { display: flex; align-items: center; gap: 10px; margin-bottom: 8px; padding: 5px; border-radius: 5px; cursor: pointer; }
    .legend-item:hover { background: rgba(255,255,255,0.1); }
    .legend-color { width: 18px; height: 18px; border-radius: 50%; border: 2px solid rgba(255,255,255,0.3); }
    .legend-section { margin-top: 20px; padding-top: 15px; border-top: 1px solid rgba(255,255,255,0.2); }
    .legend-section h4 { font-size: 0.9em; margin-bottom: 10px; color: #aaa; }
    .tooltip { position: absolute; background: rgba(0,0,0,0.9); color: #fff; padding: 15px; border-radius: 10px; max-width: 350px; font-size: 0.85em; pointer-events: none; z-index: 1000; display: none; }

    const statsRegiones = {"promotor":{"nodos":178,"aristas":177,"clusters":14},"intron":{"nodos":1422,"aristas":1421,"clusters":40},"genebody":{"nodos":1477,"aristas":1476,"clusters":41}};
    let network = null, currentRegion = null, highlightedCluster = null;
    
    document.addEventListener("DOMContentLoaded", function() {
      const regiones = Object.keys(datosRegiones);
      if (regiones.length > 0) cargarRegion(regiones[0]);
      
      document.querySelectorAll(".region-btn").forEach(btn => {
        btn.addEventListener("click", function() {
          if (datosRegiones[this.dataset.region]) {
            cargarRegion(this.dataset.region);
            document.querySelectorAll(".region-btn").forEach(b => b.classList.remove("active"));
            this.classList.add("active");
          }
        });
      });
    });
    
    function cargarRegion(region) {
      currentRegion = region;
      const datos = datosRegiones[region], stats = statsRegiones[region];
      if (!datos) return;
      
      document.getElementById("stat-nodos").textContent = stats.nodos;
      document.getElementById("stat-aristas").textContent = stats.aristas;
      document.getElementById("stat-clusters").textContent = stats.clusters;
      
      const nodes = new vis.DataSet(datos.nodos.map(n => ({
        id: n.id, label: n.label, x: n.x, y: n.y, size: n.size,
        color: { background: n.color, border: n.color, highlight: { background: n.color, border: "#fff" } },
        shape: n.shape, font: { size: 12, color: "#333" }, borderWidth: 2,
        cluster: n.cluster, tipo: n.tipo, title: n.title
      })));
      
      const edges = new vis.DataSet(datos.aristas.map((e, i) => ({
        id: i, from: e.from, to: e.to, width: Math.max(1, Math.min(4, e.weight / 200)),
        color: { color: "#ccc", highlight: "#666" }
      })));
      
      if (network) network.destroy();
      network = new vis.Network(document.getElementById("network"), { nodes, edges }, {
        physics: false, interaction: { hover: true, zoomView: true, dragView: true, dragNodes: true }
      });
      
      network.on("hoverNode", function(params) {
        const node = datos.nodos.find(n => n.id === params.node);
        if (node && node.title) {
          const tooltip = document.getElementById("tooltip");
          tooltip.innerHTML = node.title;
          tooltip.style.display = "block";
          tooltip.style.left = (params.event.pageX + 15) + "px";
          tooltip.style.top = (params.event.pageY + 15) + "px";
        }
      });
      network.on("blurNode", () => document.getElementById("tooltip").style.display = "none");
      
      actualizarLeyenda(datos.clusters);
      highlightedCluster = null;
    }
    
    function actualizarLeyenda(clusters) {
      const container = document.getElementById("cluster-legend");
      container.innerHTML = "";
      clusters.forEach(c => {
        const item = document.createElement("div");
        item.className = "legend-item";
        item.innerHTML = "<div class=\"legend-color\" style=\"background:" + c.color + "\"></div><span>Cluster " + c.cluster + " (" + c.count + ")</span>";
        item.onclick = () => filtrarCluster(c.cluster);
        container.appendChild(item);
      });
    }
    
    function filtrarCluster(clusterId) {
      const datos = datosRegiones[currentRegion];
      if (highlightedCluster === clusterId) {
        highlightedCluster = null;
        network.body.data.nodes.update(datos.nodos.map(n => ({ id: n.id, color: { background: n.color, border: n.color } })));
      } else {
        highlightedCluster = clusterId;
        network.body.data.nodes.update(datos.nodos.map(n => ({
          id: n.id, color: n.cluster === clusterId ? { background: n.color, border: n.color } : { background: "#ddd", border: "#ccc" }
        })));
      }
    }
